import { blogposts } from '../data'
import { Container } from 'react-bootstrap'

const Posts = () => {
  return (
    <div>
      <h2>Blog Posts:</h2>
      {blogposts.map((post) => (
        <div className='post'>{post}</div>
      ))}
    </div>
  )
}

export default Posts
